import axios from "axios";
import { DOMAIN } from "../../services/domainUrl";

export const postSignUp_Action = {
  signUp(data) {// recive (data) to import client Sign-Up.page
    return axios({
      method: "POST",
      url: `${DOMAIN}QuanLyNguoiDung/DangKy`,
      data,
    });
  },
};
